INSERT INTO `service` (`id`, `title`, `description`) VALUES
(1, 'L\'atelier', '<div>Notre atelier est l\'endroit idéal pour prendre soin de votre véhicule. Que vous ayez besoin d\'un entretien régulier ou de réparations mécaniques sur votre voiture, notre équipe de professionnels qualifiés est là pour répondre à tous vos besoins.</div>'),
(2, 'Nos conseils et tutos', '<div>Nos experts dévoués sont là pour répondre à toutes vos questions, qu\'il s\'agisse d\'entretien de routine, de dépannage en cas de panne, ou même de projets de personnalisation de votre voiture</div>'),
(3, 'La location de véhicules', '<div>Que vous ayez besoin d\'un véhicule pour un voyage d\'affaires, des vacances en famille ou tout simplement pour explorer de nouveaux horizons, nous avons la solution idéale pour vous.</div>');

