--
-- Dumping data for table `testimonial`
--

INSERT INTO `testimonial` (`id`, `garage_id`, `name`, `surname`, `message`, `score`, `is_actif`) VALUES
(2, 1, 'RABILLARD', 'Tony', 'Bonjour, je n\'ai pas encore eu l\'occasion de tester vos compétences en mécanique mais je vous mets ce 5 étoiles pour votre site incroyable ! \r\nJ\'ai hâte qu\'il soit fini', 5, 1),
(3, 1, 'DUPONT', 'Jean', 'J\'ai récemment eu l\'occasion de faire réparer ma voiture au Garage Vincent Parrot, et je suis extrêmement satisfait du service que j\'ai reçu. L\'équipe de mécaniciens était professionnelle, compétente et très sympathique.\r\nMa voiture avait un problème de moteur que d\'autres garages n\'avaient pas pu résoudre.', 4, 1),
(4, 1, 'LASALLE', 'Marie', 'Je recommande vivement le Garage Vincent Parrot à quiconque recherche un service automobile de qualité. Ils sont fiables, professionnels et offrent un excellent rapport qualité prix. Je suis reconnaissant pour leur excellent service et je n\'hésiterais pas à revenir chez eux pour toute réparation future de ma voiture.', 5, 1),
(5, 1, 'RELOU', 'Jean-Eude', 'Bonjour.. enfin non ! Vous ne méritez pas mes salutations, vous avez mis ma vie en danger. J\'ai récupéré ma voiture avec une pression de pneu à 2.2 bar au lieu de 2.3 !!! Je vais porter plainte pour votre incompétence. Je vous déteste', 0, 0),
(6, 1, 'DESILLUSION', 'Alla', 'Bonjour, je suis mitigé sur la prestation de votre garage. Je pensais récupérer ma voiture propre et non être capable de connaître la pointure de vos employés.. Ceci dit, la clim fonctionne de nouveau et c\'est l\'essentiel. Merci', 3, 1),
(7, NULL, 'Lesseur', 'Aurélie', 'Bien ! Très bon travail', 4, 1);

